import React from "react";

export default function Education() {
  return (
    <section id="education" className="p-5 bg-white dark:bg-gray-800 text-gray-900 dark:text-white">
      <h2 className="text-3xl font-bold mb-4">Education</h2>
      <div className="space-y-2">
        <p className="text-lg font-semibold">B.Tech in Computer Science</p>
        <p className="text-gray-600 dark:text-gray-300">XYZ University, 2019 - 2023</p>
      </div>
    </section>
  );
}
